import React from 'react'
import './Header.css'

const Header = () => {
    return(
        <div className='header'>

            <img id='logo' src='https://logodownload.org/wp-content/uploads/2014/10/netflix-logo-1-1.png'></img>
        </div>
    )
}

export default Header
